It is no problem to use autocompletion for the `$collection` variable (neither completing this variable name itself nor using it for property resp. method complection after `->`). But if I try to write a `use` statement on top and use autocompletion I receive the following error:

```
Error from Phpactor: RecursiveDirectoryIterator::__construct(/Users/danielrotter/Documents/Development/andermatt-pimcore/vendor/pimcore/pimcore/bundles/AdminBundle/Resources/public/js/pimcore/object/classes/data/geo): Failed to open directory: Too many open files
```
In addition to that instead of a correct value I get just a `0` in the editor... Adding a screenshot here to make absolutely clear how that looks:

<img width="1011" alt="image" src="https://user-images.githubusercontent.com/405874/198692675-11e71c37-38a6-421e-a307-72534fd8e8b2.png">

I once had a [similar issue with xdebug](https://superuser.com/questions/787888/too-many-files-open-on-mac-osx-after-running-apache-in-php-with-xdebug-for-som). I think back then setting something like `ulimit -n unlimited` fixed this issue for me, but it does not help now... Any ideas what is happening here?

